import React from "react";

const Navigation = ({ onSignOut }) => {
  return (
    <nav>
      <p
        style={{
          display: "flex",
          justifyContent: "flex-end",
          padding: "0 10px 0 0",
        }}
        className="f3 underline avenir dim pointer"
        onClick={() => onSignOut("signIn")}
      >
        Sign Out
      </p>
    </nav>
  );
};
export default Navigation;
